import React, { useState } from 'react';

const CameraForm = ({ onSave, onCancel, initialData = null }) => {
  const [formData, setFormData] = useState({
    name: initialData?.name || '',
    ip: initialData?.ip || '192.168.1.x',
    username: initialData?.username || '',
    password: initialData?.password || '',
    rtspUrl: initialData?.rtspUrl || ''
  });

  const [testStatus, setTestStatus] = useState(null);
  const [isTesting, setIsTesting] = useState(false);

  const generateRTSPUrl = () => {
    const { username, password, ip } = formData;
    if (username && password && ip && ip !== '192.168.1.x') {
      return `rtsp://${username}:${password}@${ip}:554/stream1`;
    }
    return '';
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    const updatedData = { ...formData, [name]: value };
    
    if (['username', 'password', 'ip'].includes(name)) {
      updatedData.rtspUrl = generateRTSPUrl();
    }
    
    setFormData(updatedData);
  };

  const handleRefreshUrl = () => {
    const newUrl = generateRTSPUrl();
    if (newUrl) {
      setFormData({ ...formData, rtspUrl: newUrl });
    }
  };

  const handleTest = async () => {
    setIsTesting(true);
    setTestStatus(null);
    
    // Simulate API call to test camera connection
    await new Promise(resolve => setTimeout(resolve, 1500));
    
    const isSuccess = Math.random() > 0.3; // 70% success rate for demo
    setTestStatus({
      success: isSuccess,
      message: isSuccess ? 'Connected Successfully' : 'Error: Not Connected'
    });
    setIsTesting(false);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!formData.name || !formData.ip || !formData.rtspUrl) {
      alert('Please fill in all required fields');
      return;
    }
    onSave(formData);
    setFormData({
      name: '',
      ip: '192.168.1.x',
      username: '',
      password: '',
      rtspUrl: ''
    });
    setTestStatus(null);
  };

  const handleCancel = () => {
    setFormData({
      name: '',
      ip: '192.168.1.x',
      username: '',
      password: '',
      rtspUrl: ''
    });
    setTestStatus(null);
    onCancel();
  };

  return (
    <form className="camera-form" onSubmit={handleSubmit}>
      <div className="form-group">
        <label>Camera Name</label>
        <input
          type="text"
          name="name"
          value={formData.name}
          onChange={handleChange}
          placeholder="Enter camera name"
          required
        />
      </div>

      <div className="form-group">
        <label>Camera IP</label>
        <input
          type="text"
          name="ip"
          value={formData.ip}
          onChange={handleChange}
          placeholder="192.168.1.x"
          required
        />
      </div>

      <div className="form-group">
        <label>Username</label>
        <input
          type="text"
          name="username"
          value={formData.username}
          onChange={handleChange}
          placeholder="Enter username"
        />
      </div>

      <div className="form-group">
        <label>Password</label>
        <input
          type="password"
          name="password"
          value={formData.password}
          onChange={handleChange}
          placeholder="Enter password"
        />
      </div>

      <div className="form-group">
        <label>RTSP URL</label>
        <div className="url-group">
          <input
            type="text"
            name="rtspUrl"
            value={formData.rtspUrl}
            onChange={handleChange}
            placeholder="Auto-generates or enter manually"
            required
          />
          <button
            type="button"
            className="refresh-btn"
            onClick={handleRefreshUrl}
            title="Generate RTSP URL"
          >
            <svg className="refresh-icon" viewBox="0 0 24 24">
              <path fill="currentColor" d="M17.65,6.35C16.2,4.9 14.21,4 12,4A8,8 0 0,0 4,12A8,8 0 0,0 12,20C15.73,20 18.84,17.45 19.73,14H17.65C16.83,16.33 14.61,18 12,18A6,6 0 0,1 6,12A6,6 0 0,1 12,6C13.66,6 15.14,6.69 16.22,7.78L13,11H20V4L17.65,6.35Z" />
            </svg>
          </button>
        </div>
      </div>

      {testStatus && (
        <div className={`status-message ${testStatus.success ? 'status-success' : 'status-error'}`}>
          <svg viewBox="0 0 24 24" width="20" height="20">
            {testStatus.success ? (
              <path fill="currentColor" d="M21,7L9,19L3.5,13.5L4.91,12.09L9,16.17L19.59,5.59L21,7Z" />
            ) : (
              <path fill="currentColor" d="M19,6.41L17.59,5L12,10.59L6.41,5L5,6.41L10.59,12L5,17.59L6.41,19L12,13.41L17.59,19L19,17.59L13.41,12L19,6.41Z" />
            )}
          </svg>
          {testStatus.message}
        </div>
      )}

      <div className="form-actions">
        <button
          type="button"
          className="test-btn"
          onClick={handleTest}
          disabled={isTesting || !formData.rtspUrl}
        >
          {isTesting ? 'Testing...' : 'Test'}
        </button>
        <button
          type="button"
          className="cancel-btn"
          onClick={handleCancel}
        >
          Cancel
        </button>
        <button
          type="submit"
          className="save-btn"
        >
          Save
        </button>
      </div>
    </form>
  );
};

export default CameraForm;
